import React from "react"

function NewDeck() {
    return (
        <>
            <h3>Create Deck</h3>
            <form>
                <inputDeck name />
                <textarea>Deck Description</textarea>
                <button type="submit">Submit</button>
            </form>
        </>
        
    )
}

export default NewDeck;
